import { Page, Text, PDFViewer , Document} from '@react-pdf/renderer';

function LectionPage(){

  return(
    <PDFViewer style={{ width: '100%', height: '100vh' }}>
      <Document file="/data/lecture/lecture_1/Лекция 1.pdf">
        <Page size="A4">
          <Text>Привет, это PDF</Text>
        </Page>
      </Document>
    </PDFViewer>
  );
}

export default LectionPage;
